To solve this, we'll apply the rule of extracting unique digits from all numbers in the given input list, sort them, and form the output list.

Input: [87, 90, 16]

- Extract digits from each number: 
  - From 87: {8, 7}
  - From 90: {9, 0}
  - From 16: {1, 6}

- Combine all these unique digits: {0, 1, 6, 7, 8, 9}

- Sort the digits: [0, 1, 6, 7, 8, 9]

So, the output list will be [0, 1, 6, 7, 8, 9].

